package song.common.toolkit.pdm;import java.util.List;/** * description: * author:          song * createDate:      2017/10/25 */public class PdmTable {    private String id;    private String objectID;    private String name;    private String code;    private String comment;    private List<PdmColumn> columns;    private List<PdmKey> keys;    private PdmKey primaryKey;    public PdmTable() {    }    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public PdmKey getPrimaryKey() {        return primaryKey;    }    public void setPrimaryKey(PdmKey primaryKey) {        this.primaryKey = primaryKey;    }    public String getObjectID() {        return objectID;    }    public void setObjectID(String objectID) {        this.objectID = objectID;    }    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    public String getCode() {        return code;    }    public void setCode(String code) {        this.code = code;    }    public String getComment() {        return comment;    }    public void setComment(String comment) {        this.comment = comment;    }    public List<PdmColumn> getColumns() {        return columns;    }    public void setColumns(List<PdmColumn> columns) {        this.columns = columns;    }    public List<PdmKey> getKeys() {        return keys;    }    public void setKeys(List<PdmKey> keys) {        this.keys = keys;    }}